import React from 'react';

class ListOfCategories extends React.Component {
  render() {
    const { categories } = this.props;
    return (
      <div>
        <p>Categorias:</p>
        { categories.map((item) => <p>item</p>)}
      </div>
    );
  }
}

export default ListOfCategories;
